Follow the steps below and write the program as directed. Test your code frequently, at the bare minimum performing every test given in the steps. If your code is not working as expected, do not move on to the next step until you have fixed it. Moving on without finishing a step correctly will make the problem significantly harder to fix and likely add new problems as you continue working. If you disregard this advice, then you may get to the end of the steps and find it would actually be less work to start over from step 1 than to debug the code you just finished writing. This program requires two additional pieces of input. Prompt the player for their character's ancestry and class after the character name and before the level. Test these new prompts like you tested the prompts in 1.1: run the program, make sure the prompts appear, and make sure the variables have the expected value after all of the prompts are finished. If the user enters invalid input, then our program must print an error message and exit. You should modify your prompts to tell the user what input is allowed for the ancestry, class, level, and ability scores. This will be a helpful reminder when you test the program. Note: You can check each input value immediately after the prompt, or you can check all of them in a separate section of your program after all of the input is finished. The first option will give a better user experience because you will know right away when you make a mistake, and you won't waste time entering more input before the program exits. It also makes your program faster to test for the same reasons. The second option makes it a little easier to organize the code, and all of the error-checking could be combined into one if statement. I recommend the first option because I believe you'll benefit the most from the ease of testing. My directions will only describe how to code this option. Add an if statement after the level prompt. A valid level is an integer between 1 and 20, inclusive. We want to check whether it is invalid , so we need a condition that asks whether the level is outside of this range. An invalid level is either less than 1 or greater than 20. There are two parts to this condition, so we need to join them with an AND (&&) or an OR (||). In this case, we should use OR. There are a couple of ways to determine that OR is appropriate: the wording of the condition when we describe it in English only makes sense with the word "or", and we only need to meet one of these two conditions for the level to be invalid (it's not even possible for it to be both less than 1 and greater than 20 at the same time). In the body of our if statement, we need to print an error message and exit our program. The exact error message is ERROR: INVALID INPUT, and we can exit the program with System.exit(1);. Any integer is a valid argument for the System.exit function, but a value other than 0 means the program encountered an error. All together, the prompt with error checking would look something like this: // prompt for input
System.out.println("level prompt message");
int variableName = nextInt(); // check for invalid input
if (/*TODO: condition*/) { println("ERROR: INVALID INPUT"); // The /exit command won't work here because this whole block is part of a // Java code snippet. Jshell expects everything in a snippet to be valid // Java code. exit(1);
} You can use a similar prompt to check each ability score. The ability scores must be integers between 8 and 15 inclusive. After you add the error-checking for the level and abilities, you should test each of them a few times. Try a few values inside and outside the range, and make sure the program exits with the error message if and only if you enter a value outside the range. In particular, you should check the boundaries of the range. One of the most common mistakes in this type of code is to make a range inclusive when it should have been exclusive, or to make it exclusive when it should have been inclusive. If you make that mistake, then your code will work correctly for all but one or two numbers. You should check 0, 1, 20, and 21 for the level, as well as 7, 8, 15, and 16 for each ability score. Once your error-checking code works for the numbers, you also need to check the ancestry and class. Each of these have three options, and the user's input is invalid if it is not equal to one of these options. This means we have three parts to our condition, and they must be joined with AND or OR. Which is appropriate? Let's try describing invalid input more closely to how we would code it (checking each possibility separately) and see whether AND or OR is more natural: an invalid ancestry is not an elf and it is not a dwarf and it is not a human. Therefore we should use AND (&&). However, this can be tricky. There's another way to phrase our condition that sounds natural and uses OR instead of AND: "an invalid ancestry is not an elf, dwarf, or human". Does this mean it doesn't matter whether we use AND or OR? No, it still matters. The trick with this phrase is how it looks when structured like code: "it is not true that (an invalid ancestry is an elf or it is a dwarf or it is a human)." We are using or to join several equality checks (instead of inequality checks), then applying the NOT (!) to the entire expression, which I've indicated by wrapping most of the expression in parenthesis. You'll develop an intuition for boolean logic with practice, so don't worry if you had a hard time with this part. I'll summarize everything you need to know for the AND solution to this error check: Check whether the ancestry/class is NOT equal to each option. Join each of these comparisons with AND (&&). Never compare strings with s1 == s2 or s1 != s2. This will not work as you want it to. Instead, compare them using the .equals function: s1.equals(s2) for equality and !s1.equals(s2) for inequality. Valid ancestries are "elf", "human", and "dwarf". Valid classes are "fighter", "rogue", and "ranger". Use the lowercase versions of these names. You're free to assume all the user's input for class and ancestry will be lowercase, and I will only use lowercase input for these traits when testing your code. However, if you want your program to ignore case, then you can modify the code that reads their input for class and ancestry by changing nextLine() to nextLine().toLowerCase(). This will convert any capital letters in the user input to lowercase letters. Another solution is to use .equalsIgnoreCase instead of .equals, which will let you check for equality while preserving the user's capitalization. If we use .equalsIgnoreCase and don't convert the input to lowercase, then our output will use the same capitalization as the user. This may or may not be desirable; it depends on how you want the output to look. Remember to test your new error-checking code. You should now get an error message if you don't enter a valid ancestry or class, but the program should still work if you enter valid input for everything. Now we need to update the calculations. We can break this into three phases: adjust ability scores, calculate ability modifiers, and calculate other values. We'll start with adjusting the ability scores. Each ancestry changes one or more ability scores. Humans increase all of their scores by 1, elves increase their dexterity by 2, and dwarves increase their constitution by 2. You can structure this part as an else-if chain: if (variableName.equals("ancestry1")) { // TODO: adjust ability scores for ancestry 1
} else if (variableName.equals("ancestry2")) { // TODO: adjust ability scores for ancestry 2
} else if (variableName.equals("ancestry3")) { // TODO: adjust ability scores for ancestry 3
} else { // We don't need this, but it can make debugging easier. If we made a // mistake in our error-checking code and allowed an invalid ancestry, or // if we add more ancestries later and forget to update this part, then // we'll see this error message and know we made a mistake. This error // message is for us, not the user. We should only see it if our code is // wrong. println("ERROR: UNRECOGNIZED ANCESTRY! SKIPPING ADJUSTMENTS");
} After you adjust ability scores for the character's ancestry, you need to calculate each ability's modifier. This is a separate number from the score, and it's used in most calculations that care about the ability instead of the raw score. The Project 1 Background section explains the difference between ability scores and modifiers in more detail. The SRD has a table showing the modifier for each ability score. However, we can more easily calculate this with a short formula: abilityModifier = (abilityScore / 2) - 5. The parenthesis aren't necessary, but they emphasize the order of operations. Dividing after subtraction ((abilityScore - 10) / 2) would not give us the correct modifier for some scores below ten. The Calculations section covers the remaining calculations you need to perform. You can find the relevant formulas and other information there. Some of these calculations change depending on the class, so you should use an else-if chain similar to what you wrote for the ancestry adjustments. However, make sure you declare any variables before the start of the if-else chain. If you declare a variable inside an if or else body, then that variable will only exist inside that code block, and it won't be available later when you perform other calculations or print your output. Here's an outline to get started: // Declare all new variables here
int hp = 0;
// TODO: other variables if (variableName.equals("class1")) { hp = /*TODO: class 1 hp calculations*/; // TODO: other class 1 calculations
} else if (variableName.equals("class2")) { // TODO: class 2 calculations
} else if (variableName.equals("class3")) { // TODO: class 3 calculations
} else { // As with the ancestry section, the extra else can help with debugging println("ERROR: UNRECOGNIZED CLASS! SKIPPING CALCULATIONS");
} Test your code. We haven't updated the output yet, but you can run the program and check the value of each variable from the calculations section to make sure it's what you were expecting. Finally, you can adjust the output to follow the new format for 1.2 and show all of the new information you've calculated. Two of the formatting requirements can be tricky to figure out: adding a plus to any nonnegative modifiers and right-aligning the ability scores. You can use if statements to handle this, but the printf function solves this problem much more easily than an if statement. I won't explain printf here, so read the notes if you aren't familiar with it. The formatting specifiers you'll need are %2d to right-align an ability score and %+d to force a plus or minus sign in front of an ability modifier.
